import React from 'react';

function Cal()
{
    return ("Exmaple of calculator");
}
function Sum(a,b)
{
    return (a+b);
}

function Sub(a,b)
{
    return (a-b);
}
function Mul(a,b)
{
    return (a*b);
}
function Div(a,b)
{
    return ((a+b).toFixed(2));
}

export {Sum,Sub,Mul,Div};
